import { Title, SubTitle } from "../Components.js";
import './CSS/Gemeinde.css';

export default function Gottesdienste(){
    return (
        <>
            <Title title="Gemeinde"/>

            <SubTitle title="Gottesdienste"/>
            <Zeitplan/>

            <SubTitle title="Anfahrt"/>
            <Anfahrt/>

            <SubTitle title="Kalendar"/>
        </>
    );
}

function Zeitplan(){
    return(
        <div className="zeitplan-shell">
            <table className="zeitplan">
                <tr>
                    <td>Mittwoch</td>
                    <td>18 Uhr</td>
                    <td>Bibelstunde</td>
                </tr>
                <tr>
                    <td>Donnerstag</td>
                    <td>19:30 Uhr</td>
                    <td>Jugendstunde</td>
                </tr>
                <tr>
                    <td>Freitag</td>
                    <td>18 Uhr</td>
                    <td>Gebetsstunde</td>
                </tr>
                <tr>
                    <td>Sonntag</td>
                    <td>10 Uhr</td>
                    <td>Gottesdienst</td>
                </tr>
                <tr>
                    <td></td>
                    <td>17 Uhr</td>
                    <td>Gottesdienst</td>
                </tr>
            </table>
        </div>
    );
}


function Anfahrt(){
    return(
        <div className="anfahrtPanel">
            <Map/>
            <div className="addressPanel">
                <h3 className="addressParagraph">Adresse</h3>
                <p className="addressParagraph">Uphuser Heerstra√üe, 102</p>
                <p className="addressParagraph">28832 Achim</p>
            </div>
        </div>
    );
}

function Map(){
    return(
        <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d8098.25346703186!2d8.950170087566342!3d53.03302870893157!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47b0df4066c90c79%3A0x6825acbfc5524e8d!2sUphuser%20Heerstra%C3%9Fe%20102%2C%2028832%20Achim!5e0!3m2!1sde!2sde!4v1637613900873!5m2!1sde!2sde"
        class="mapsFrame" title="Google Maps to church location" allowfullscreen="true" loading="lazy"></iframe>
    );
}
